import React from "react";

const ToDoLists = (props) => {
  
  return (
    <>
      <div className="todo">
        <i className="fa fa-times" aria-hidden="true" onClick={props.onSelect}>x</i>
        <li>{props.text}</li>
      </div>
    </>
  );
};
export default ToDoLists;
